import { BASE_URL } from '../globals';
import { useState, useEffect } from 'react';
import axios from 'axios';

export default function Markets() {
  const API_KEY = process.env.REACT_APP_MS_API_KEY;
  const [isEndOfDay, setEndOfDay] = useState('');
  const [isStockTicker, setStockTicker] = useState('');
  const [isExchange, setExchange] = useState('');
  const [isCurrency, setCurrency] = useState('');

  // useEffect(() => {
  //   getEndOfDay();
  //   getStockTicker();
  //   getExchange();
  //   getCurrency();
  // }, []);

  async function getEndOfDay() {
    try {
      const response = await axios.get(
        `${BASE_URL}eod?access_key=${API_KEY}&symbols=AAPL`
      );
      // const endOfDayJson = response.json();
      // const { symbol, adj_open, adj_close } = endOfDayJson;
      // document.getElementById('symbol').textContent = symbol;
      // document.getElementById('adj_open').textContent = adj_open;
      // document.getElementById('adj_close').textContent = adj_close;

      setEndOfDay(JSON.stringify(response.data.data, null, 2));
      response.data.data.map((row) => {
        return (
          <div>
            <tb>
              <tr>
                <td>${row.symbol}</td>
                <td>${row.adj_open}</td>
                <td>${row.adj_close}</td>
              </tr>
            </tb>
          </div>
        );
      });
      // console.log(`Symbol: ${response.data.data[0].symbol}`);
      // console.log(`Open: ${response.data.data[0].adj_open}`);
      // console.log(`Close: ${response.data.data[0].adj_close}`);
    } catch (error) {
      console.error(error);
    }
  }

  async function getStockTicker() {
    try {
      const response = await axios.get(
        `${BASE_URL}tickers?access_key=${API_KEY}`
      );
      setStockTicker(JSON.stringify(response.data.data, null, 2));
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

  async function getExchange() {
    try {
      const response = await axios.get(
        `${BASE_URL}exchanges?access_key=${API_KEY}`
      );
      setExchange(JSON.stringify(response.data.data, null, 2));
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

  async function getCurrency() {
    try {
      const response = await axios.get(
        `${BASE_URL}currencies?access_key=${API_KEY}`
      );
      setCurrency(JSON.stringify(response.data.data, null, 2));
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

  // const endOfDayRender = response.data.data.map(endOfDayIndex) => (
  //     <div className='endOfDaySymbol' key={data.symbol}>{response.data.data[0].symbol}</div>
  //     <div className='endOfDayOpen' key={data.adj_open}>{response.data.data[0].adj_open}</div>
  //     <div className='endOfDayClose' key={data.adj_close}>{response.data.data[0].adj_close}</div>;
  //   )

  return (
    <div className="market-button">
      <button onClick={getEndOfDay}>Get End of Day Report</button>
      <button onClick={getStockTicker}>Get Stock Information</button>
      <button onClick={getExchange}>Get Information on the Exchanges</button>
      <button onClick={getCurrency}>
        Get Information on Different Currencies
      </button>
      <table>
        <th>
          <td>Symbol</td>
          <td>Open</td>
          <td>Close</td>
        </th>
        {isEndOfDay}
      </table>
      <p>{isStockTicker}</p>
      <p>{isExchange}</p>
      <p>{isCurrency}</p>
    </div>
  );
}
